import React, { Component } from 'react';
import { Text, SafeAreaView, TouchableOpacity, ScrollView } from 'react-native';
import Color from './constants/colors'

export class CustonDrawerContent extends Component{
    render(){
        return(
            <SafeAreaView style ={{flex:1 , backgroundColor:Color.darkpurple}}>

              <ScrollView style={{marginLeft:10}}>

                <TouchableOpacity
                style={{marginTop:50}}
                onPress = {() => this.props.navigation.navigate('Menu')}
                >
                  <Text style={{color:'white', fontWeight:'bold', fontSize:20}}>COVID-19 TH</Text>
                </TouchableOpacity>

                
                <TouchableOpacity
                style={{marginTop:20}}
                onPress = {() => this.props.navigation.navigate('COVID-19')}
                >
                  <Text style={{color:'white', fontWeight:'normal', fontSize:24,  paddingLeft:12, marginRight:12, backgroundColor:'#BA55D3',}}></Text>
                  <Text style={{color:'white', fontWeight:'normal', fontSize:32,  paddingLeft:12, marginRight:12, backgroundColor:'#BA55D3',}}>ที่มาของโรค</Text>
                  <Text style={{color:'white', fontWeight:'normal', fontSize:32,  paddingLeft:12, marginRight:12, backgroundColor:'#BA55D3',}}></Text>
                </TouchableOpacity>
                

                <TouchableOpacity
                style={{marginTop:20}}
                onPress = {() => this.props.navigation.navigate('Origin')}
                >
                  <Text style={{color:'white', fontWeight:'normal', fontSize:32,  paddingLeft:12, marginRight:12, backgroundColor:'#BA55D3',}}></Text>
                  <Text style={{color:'white', fontWeight:'normal', fontSize:32,  paddingLeft:12, marginRight:12, backgroundColor:'#BA55D3',}}>ต้นกำเนิดของไวรัส</Text>
                  <Text style={{color:'white', fontWeight:'normal', fontSize:32,  paddingLeft:12, marginRight:12, backgroundColor:'#BA55D3',}}></Text>
                </TouchableOpacity>

                <TouchableOpacity
                style={{marginTop:20}}
                onPress = {() => this.props.navigation.navigate('Event')}
                >
                  <Text style={{color:'white', fontWeight:'normal', fontSize:32,  paddingLeft:12, marginRight:12, backgroundColor:'#BA55D3',}}></Text>
                  <Text style={{color:'white', fontWeight:'normal', fontSize:32,  paddingLeft:12, marginRight:12, backgroundColor:'#BA55D3',}}>เหตุการณ์ระบาดเป็นวงกว้าง</Text>
                  <Text style={{color:'white', fontWeight:'normal', fontSize:32,  paddingLeft:12, marginRight:12, backgroundColor:'#BA55D3',}}></Text>
                </TouchableOpacity>

                <TouchableOpacity
                style={{marginTop:20}}
                onPress = {() => this.props.navigation.navigate('Trans')}
                >
                  <Text style={{color:'white', fontWeight:'normal', fontSize:32,  paddingLeft:12, marginRight:12, backgroundColor:'#BA55D3',}}></Text>
                  <Text style={{color:'white', fontWeight:'normal', fontSize:32,  paddingLeft:12, marginRight:12, backgroundColor:'#BA55D3',}}>การแพร่เชื้อ</Text>
                  <Text style={{color:'white', fontWeight:'normal', fontSize:32,  paddingLeft:12, marginRight:12, backgroundColor:'#BA55D3',}}></Text>
                </TouchableOpacity>

                <TouchableOpacity
                style={{marginTop:20}}
